const RosterPaymentsPage = () => {
  return (
    <div style={{ padding: '20px' }}>
      <h2>Player Roster & Payments</h2>
      <p>This page displays the full list of players and their payment status.</p>
      {/* TODO: Add roster list and payment tracking logic */}
    </div>
  );
};

export default RosterPaymentsPage;
